.node circle {

}

}

.link {

  stroke-width: 1.5px;
}

    <div id="chart"></div>

<script>
var w = 15000,
    h = 5000;

var tree = d3.layout.tree()
    .size([w, h/3 ]);

var VERTICAL_SPACING = 8;


var diagonal = d3.svg.diagonal()
    .projection(function(d) { return [d.x, d.y]; });

var vis = d3.select("#chart").append("svg")
    .attr("width", w)
    .attr("height", h)
    .append("g")
    .attr("transform", "translate(-40, 40)");


function exec (json) {
  var nodes = tree.nodes(json);

  //draws the connections between the items  
  var link = vis.selectAll("path.link")
      .data(tree.links(nodes))
      .enter().append("path")
      .attr("class", "link")
      .attr("d", diagonal);

    
  //controls where the circles and text actually get drawn.  
  var node = vis.selectAll("g.node")
      .data(nodes)
      .enter().append("g")
      .attr("class", "node")
      .attr("transform", function(d) { return "translate(" + d.x + "," + d.y + ")"; });

  node.append("circle")
      .attr("r", 4.5); //circle radius


  node.append("text")
      .attr("dx", function(d) {
       if (d.children)
          -8;
       else
       {
          if(d.drawHigh)
            return 2;
       }
       return -8;
       })
      .attr("dy", function(d) { if (d.drawHigh) return -8; return 12;})
      .attr("text-anchor", function(d) { return d.children ? "end" : "start"; })
      .text(function(d) { return d.name; });


  //draws value
  node.append("text")
      .attr("dx", function(d) {
       if (d.children)
          -8;
       else
       {
          if(d.drawHigh)
            return 2;
       }
       return -8;
       })
      .attr("dy", function(d)
                  {
                      if (d.drawHigh)
                          return -8 + 1*VERTICAL_SPACING;
                      return 12 + 1*VERTICAL_SPACING;
                  })
      .attr("text-anchor", function(d) { return d.children ? "end" : "start"; })
      .text(function(d)
            {
               if(d.value)
                 return d.value;
               return '--';
            });

  //draws type
  node.append("text")
      .attr("dx", function(d) {
       if (d.children)
          -8;
       else
       {
          if(d.drawHigh)
            return 2;
       }
       return -8;
       })
      .attr("dy", function(d)
                  {
                      if (d.drawHigh)
                          return -8 + 2*VERTICAL_SPACING;
                      return 12 + 2*VERTICAL_SPACING;
                  })
      .attr("text-anchor", function(d) { return d.children ? "end" : "start"; })
      .text(function(d)
            {
               if(d.type)
                 return d.type;
               return '--';
            });

  //draws slice annotation name
  node.append("text")
      .attr("dx", function(d) {
       if (d.children)
          -8;
       else
       {
          if(d.drawHigh)
            return 2;
       }
       return -8;
       })
      .attr("dy", function(d)
                  {
                      if (d.drawHigh)
                          return -8 + 3*VERTICAL_SPACING;
                      return 12 + 3*VERTICAL_SPACING;
                  })
      .attr("text-anchor", function(d) { return d.children ? "end" : "start"; })
      .text(function(d)
            {
               if(d.sliceAnnotationName)
                 return d.sliceAnnotationName;
               return '--';
            });


  //draws slice annotation type name
  node.append("text")
      .attr("dx", function(d) {
       if (d.children)
          -8;
       else
       {
          if(d.drawHigh)
            return 2;
       }
       return -8;
       })
      .attr("dy", function(d)
                  {
                      if (d.drawHigh)
                          return -8 + 4*VERTICAL_SPACING;
                      return 12 + 4*VERTICAL_SPACING;
                  })
      .attr("text-anchor", function(d) { return d.children ? "end" : "start"; })
      .text(function(d)
            {
               if(d.sliceAnnotationType)
                 return d.sliceAnnotationType;
               return '--';
            });

}
